import './App.scss';
import React from "react";
import Header from "./Components/Header/Header";
import {BrowserRouter} from "react-router-dom";
import {Route, Switch} from "react-router";
import Patient from "./Components/Main Content/Patient/Patient";
import PatientInformation from "./Components/Main Content/Patient/Patient Information/PatientInformation";
 import {patientURLS} from "./Constants/URLConstants";
function App() {

    return (
        <div className="application">
            <BrowserRouter>
                <Header/>
                <main className="main-content">
                    <Switch>

                        {/*patient routes*/}
                        <Route exact path={patientURLS.patient} component={Patient}/>
                        <Route exact path={`${patientURLS.patientInfo}/:id`} component={PatientInformation}/>

                        {/*employee routes*/}
                        <Route exact path={patientURLS.patient} component={Patient}/>

                    </Switch>
                </main>

            </BrowserRouter>

        </div>
    );
}

export default App;
